query_text:
SELECT *
FROM uservisits
WHERE sourceip = '1.7.90.218' and visitdate between '1995-01-07' and '1995-01-08';

SELECT max(visitdate) as latest_visit
FROM uservisits
WHERE (visitdate >= '2006-10-27' AND visitdate <= DATE_ADD('DAY', 1, '2006-10-27'));

SELECT r.*, v.visitdate, v.adrevenue
FROM uservisits v inner join rankings r on v.destinationurl = r.pageurl
WHERE sourceip ='214.114.75.215' and visitdate between '1992-07-09' and '1992-07-15';

SELECT destinationurl, COUNT(*) AS visit_count FROM UserVisits WHERE (countrycode ='BHR' or countrycode = 'LBY') 
 AND EXTRACT(YEAR FROM visitDate) = 1994 AND EXTRACT(MONTH FROM visitDate) = 4 
 GROUP BY destinationurl LIMIT 100;
